In this section, we apply our proposed SEA to evaluate 30 recent open-source VIF methods, as detailed in Table II, utilizing three comprehensive segmentation models: SEEM, X-Decoder, and G-SAM. The quantitative results on the FMB dataset are presented in Table III, revealing several key observations:
First, only 3 methods (U2Fusion, CDDFuse, and SDCFusion) demonstrate a clear performance improvement (exceeding a 1.0 increase in mIoU) over the Visible in the Mean across all segmentation models;
Second, unified models trained on VIF datasets with segmentation labels do not show superior segmentation results compared to non-unified models trained on VIF datasets without segmentation labels, unified CNN-based models such as TIM and MRFS exhibit worse quantitative performance compared to non-unified CNN-based models like PIAFusion and MetaFusion;
Third, generative VIF methods, particularly those based on GANs (FusionGAN, DDcGAN, TarDAL, DDBF) and diffusion models (DifFusion and DDFM), exhibit poor performance, with all methods performing noticeably worse than using the Visible images (by more than 1.0 in mIoU), and the GAN-based method FusionGAN even under-performing the Infrared;
Finally, the latest VIF methods do not show advantages over older VIF methods, for instance, the latest methods such as DDBF and MRFS (published in 2024) show inferior quantitative performance compared to older methods like DenseFuse (published in 2019) and U2Fusion (published in 2020).

